          <Option Name=""VAT Class H"" Value=""H"" />
        </Options>
        <Desc>1 character for VAT class: 
 - 'A' - VAT Class A 
 - 'B' - VAT Class B 
 - 'C' - VAT Class C 
 - 'D' - VAT Class D 
